import React from 'react';
import Hero from '../components/Hero';
import Content from '../components/Content';

function AboutPage(props){

    return(
        <div>
            <Hero title={props.title} />

            <Content>
                <p>Hello there!</p>
                <p>I'm computer science graduate student. I taked technical degree in software development
                    and system administration, before o started bachelor degree.
                </p>
            </Content>
        </div>
    );

}

export default AboutPage;
